import React, { useState } from "react";
import styles from '../styles.module.css'

const unitConversions = {
    "MILESMETERS": 1609.34,
    "METERSMILES": 0.000621371,
    "KMMETERS": 1000,
    "METERSKM": 0.001,
    "MILESKM": 1.60934,
    "KMMILES": 0.621371
}

export default function Calculator(){

    const [time, setTime] = useState({"hours": 0, "minutes": 0, "seconds": 0});
    const [timeText, setTimeText] = useState("");
    const [distance, setDistance] = useState(0);
    const [calculatedPace, setCalculatedPace] = useState({"hours": 0, "minutes": 0, "seconds": 0});

    function GetPace(time, distanceTraveled, distancePace, unit, unitToConvert){
        let conversion = 1;
        if(unit !== unitToConvert){
            conversion = unitConversions[unitToConvert + unit];
        }
        let timeInSeconds = time.hours * 3600 + time.minutes * 60 + time.seconds;
        let secondsPer = timeInSeconds / distanceTraveled;

        let hours = Math.floor(secondsPer / 3600);
        let minutes = Math.floor((secondsPer - hours * 3600) / 60);
        let seconds = secondsPer - hours * 3600 - minutes * 60;

        return {"hours": hours, "minutes": minutes, "seconds": seconds};
    }

    function GetPaces(time, distanceTraveled, unit){
        /*
        let paces = {
            "100m": {}, 
            "200m": {}, 
            "400m": {}, 
            "600m": {}, 
            "800m": {},
            "1k": {},
            "1500m": {},
            "1600m" : {},
            "1mi": {},
            "3k": {},
            "2mi": {},
            "5k": {},
            "10k": {},
            "1/2 Marathon": {},
            "Marathon": {}
        }
        */
        let paces = {
            "400m": GetPace(time, distanceTraveled, 400, unit, "METERS"),
            "800m": GetPace(time, distanceTraveled, 800, unit, "METERS"),
            "1k": GetPace(time, distanceTraveled, 1, unit, "KM"),
            "1mi": GetPace(time, distanceTraveled, 1, unit, "MILES"),
            "3k": GetPace(time, distanceTraveled, 3, unit, "KM"),
            "2mi": GetPace(time, distanceTraveled, 2, unit, "MILES"),
            "5k": GetPace(time, distanceTraveled, 5, unit, "KM")
        };
    }

    function formatTime(numericalTime){
        let formattedText = "";

        for(var i = numericalTime.length - 1; i >= 0; i--){
            if(i < numericalTime.length - 1 && (numericalTime.length - i) % 2 === 1){
                if(numericalTime.length - i < 6) {
                    formattedText = ":" + formattedText;
                }
            }
            formattedText = numericalTime[i] + formattedText;
        }

        return formattedText;
    }

    const handleOnChange = (e) => {
        let numericalString = e.target.value.replaceAll(":", "");

        let timeString = numericalString.padStart(5, '0')

        let seconds = Number(timeString.slice(-2));
        let minutes = Number(timeString.slice(-4, -2));
        let hours = Number(timeString.slice(0, -4));
        setTime({hours: hours, minutes: minutes, seconds: seconds});

        //console.log({hours: hours, minutes: minutes, seconds: seconds});

        let formattedText = formatTime(numericalString);

        setTimeText(formattedText)
    }

    return(
        <div>
            <div className={styles.container}>
                <input className={styles.timeField} value={timeText} onChange={e => handleOnChange(e)}></input>
                <input type="number" className={styles.inputField} onChange={e => setDistance(e.target.value)}></input>
                <button className={styles.button} onClick={() => setCalculatedPace(GetPace(time, distance, 1, 0, 0))}>Get Pace</button>

            </div>
            <div className={styles.container}>
                <table className={styles.paceTable}>
                    <tr>
                        <th className={styles.tableElement}>Distance:</th>
                        <th className={styles.tableElement}>Time:</th>
                    </tr>
                    <tr>
                        <th className={styles.tableElement}>400m</th>
                        <th className={styles.tableElement}>1:01</th>
                    </tr>
                    <tr>
                        <th className={styles.tableElement}>800m</th>
                        <th className={styles.tableElement}>2:13</th>
                    </tr>
                </table>
            </div>
        </div>
    );
}
